import React from 'react';
import './style.css';

function Contactme() {
    return(
        <div className='container'>
            <div className='row'>
                <div className='col s12'>
                    <h1 className='blue-text'><b>REACH</b>ME</h1>
                </div>
                <div className='col s2 blue-text'><hr/></div>
                <div className='col s12'>
                    <h5 className='blue-text'><b><i><i style={{verticalAlign: 'middle'}} class="small material-icons">send</i> pkennedytx1@gmail.com</i></b></h5>
                </div>
                <div className='col s12'>
                    <h5><b>Linked</b><i class="fab fa-linkedin"></i></h5>
                </div>
            </div>
        </div>
    )
}

export default Contactme;
